import React from 'react';
import './LibraryPage.css';

function LibraryPage() {
    return (
        <div id='landing__container'>
            <div id='landing__content'>
                <div id='landing__content-main'>
                    Listening is everything
                </div>
            </div>
        </div>
    )
}

export default LibraryPage;
